void MainComponent::showFileDialogue()
{
    DBG("create file chooser");
   // juce::FileChooser dlg("Select MIDI Data file", juce::File::getCurrentWorkingDirectory(), "*.xml");
    chooser = std::make_unique<juce::FileChooser>("Select MIDI Data file", juce::File::getCurrentWorkingDirectory(), "*.xml");
    chooser->launchAsync(
        juce::FileBrowserComponent::openMode | juce::FileBrowserComponent::canSelectFiles,
        [this](const juce::FileChooser& chooser)
        {

            auto file = chooser.getResult();
            if (file.exists())
            {
                (*audioProcessor).loadXmlFile(file);
            }
        }
    );
}
